export default function QuickView({title, brand, price, image, description}) {
    return (
        <div className="quick-view">
            <div className="quick-view-image" style={
                {
                    background: `url(${image}) no-repeat`,
                    backgroundSize: "cover",
                    backgroundPosition: "center",
                    width: "400px",
                    height: "100%"
                }
            }>

            </div>
        </div>
    )
}
